import React from 'react'
import Hero from '../Components/HeroTop/Hero';
import Popular from '../Components/Popular/Popular';
import Offer from '../Components/Offers/Offer';



const Shop = () => {
  return (
    <div>
     <Hero/>
     <Popular/>
     <Offer/>
     
    </div>
  )
}

export default Shop;
